import React from "react";
import ReactDOM from "react-dom";

const name = "Kenan";

ReactDOM.render(
<div>
  <h1>{name} brothers</h1>
  <ul>
     <li>Kenan</li>
     <li>Faris</li>
     <li>Dino</li>
  </ul>
</div>, 
document.getElementById("root"));
